const imgStyle = {
    height: "200px",
    weight: "200px",
}
const divStyle = {
    borderStyle: "solid",
    height: "400px",
    weight: "400px"
}
const ib = {
    display: "inline-block"
}

function Img_box1(props){
    function handleClick(event){
        console.log(event.target.name.storeName);
    }
    console.log(props.id);
    return <div className = "img-box1">
        <img style = {imgStyle} src = {props.url} alt = "img"/>
        <p>{props.name}</p>
        <p>{props.price}</p>
        <button name= {props.id} onClick={handleClick}>Add To Cart</button>
    </div>
}
export default Img_box1;
